import AOS from 'aos';
import './app.css'
import Catalog from './pages/Catalog/Catalog';
import Main from "./pages/Main/Main";
import { BrowserRouter, Routes, Route } from 'react-router-dom'


const App = () => {
  AOS.init()
  return (
    <BrowserRouter>
      <Main>
        <Routes>
          <Route path="/" element={<Main />} exact/>
          <Route path="/catalog" element={<Catalog />} exact/>
        </Routes>
      </Main>
    </BrowserRouter>
  )
}

export default App
